pack.','will'),(3,'ACM Weekly','Week of 10/19/2015',1445625795,'Hello, ACM! I hope you enjoyed your fall break. Now it’s time to get back to business. This is what we have planned for this week:\n\n**Monday: Digital CTF — 6:00 PM in Shelby 3129:** Auburn’s Digital Capture the Flag group will be holding a meeting in Shelby’s seminar room. They will be discussing to train for competitions, they will be discussing some topics included in the competitions, such as Reverse Engineering and Cryptography.\n\n**Tuesday: Tech Talk — 6:00 PM in Shelby 3129:** Matthew Rogers will be giving a talk on a project that he has been working on, Malfunction. Malfunction is a malware detection tool set written in python. It is a really cool project, and there will be a lot of cool topics covered, so come on and check it out. \n\n**Wednesday: Programming Practice — 6:00 PM in Shelby 3129:** We will be reviewing Union-Find and doing an introduction to some more advanced data structures, along with beginning some graph theory.\n\n**Thursday: Tea Time — 6:00 PM at Little Italy on Magnolia:** Come get some pizza with us at Little Italy on Thursday!\n\n**Sunday: Mock Programming Competition — 12:00 PM:** We will be holding a mock competition on Sunday. Once again, this will be a team-based mock, although the teams may be different from last time. Everyone is welcome, even if you have not participated before.\n\nThat’s all for this week! I hope to see you there.','will');
