INSERT INTO `problem_data` VALUES (1,90,'This problem is based on the game of Black Vienna. In this version there are three players and 18 cards labeled A-R. Three of the cards\r\nare set aside (hidden) and form the \"Black Vienna\" gang. The remaining cards are shuffled and dealt to the players so that each player has\r\n5 cards. Players never reveal their cards to each other. There is a separate deck of \"interrogation cards\" which contain three distinct\r\nletters in ascending order, like ACG or BHR. Turns rotate through players 1, 2, and 3. On each player\'s turn, that player selects an\r\ninterrogation card, puts it face up in front of another player, and that other player must indicate the total number of these cards being\r\nheld, without saying which ones. All players see the result of the \"interrogation\". The play continues until a player deduces the three\r\ncards in the \"gang\".','null','null'),(2,90,NULL,NULL,NULL),(3,90,NULL,NULL,NULL),(4,90,NULL,NULL,NULL),(5,90,NULL,NULL,NULL),(6,90,NULL,NULL,NULL),(7,90,NULL,NULL,NULL),(8,90,NULL,NULL,NULL),(9,90,NULL,NULL,NULL),(10,90,NULL,NULL,NULL),(11,90,NULL,NULL,NULL),(12,90,NULL,NULL,NULL),(13,90,NULL,NULL,NULL),(14,90,NULL,NULL,NULL),(15,90,NULL,NULL,NULL),(16,90,NULL,NULL,NULL),(17,90,NULL,NULL,NULL),(18,90,NULL,NULL,NULL),(19,90,NULL,NULL,NULL),(20,90,NULL,NULL,NULL),(21,90,NULL,NULL,NULL),(22,90,NULL,NULL,NULL),(23,90,NULL,NULL,NULL),(24,90,NULL,NULL,NULL),(25,90,NULL,NULL,NULL),(26,90,NULL,NULL,NULL),(27,90,NULL,NULL,NULL),(28,90,NULL,NULL,NULL),(29,90,NULL,NULL,NULL),(30,90,NULL,NULL,NULL),(31,90,NULL,NULL,NULL),(32,90,NULL,NULL,NULL),(33,90,NULL,NULL,NULL),(34,90,NULL,NULL,NULL),(35,90,NULL,NULL,NULL),(36,90,NULL,NULL,NULL),(37,90,NULL,NULL,NULL),(39,90,NULL,NULL,NULL),(40,90,NULL,NULL,NULL),(41,90,NULL,NULL,NULL),(42,90,NULL,NULL,NULL),(43,90,NULL,NULL,NULL),(44,90,NULL,NULL,NULL),(45,90,NULL,NULL,NULL),(46,90,NULL,NULL,NULL),(47,90,NULL,NULL,NULL),(48,90,NULL,NULL,NULL),(49,90,NULL,NULL,NULL),(50,90,NULL,NULL,NULL),(51,90,NULL,NULL,NULL),(52,90,NULL,NULL,NULL),(53,90,NULL,NULL,NULL),(54,90,NULL,NULL,NULL),(55,90,NULL,NULL,NULL),(56,90,NULL,NULL,NULL),(57,90,NULL,NULL,NULL),(58,90,NULL,NULL,NULL),(59,90,NULL,NULL,NULL),(60,90,NULL,NULL,NULL),(61,90,NULL,NULL,NULL),(62,90,NULL,NULL,NULL),(63,90,NULL,NULL,NULL),(64,90,NULL,NULL,NULL),(65,90,NULL,NULL,NULL),(66,90,NULL,NULL,NULL),(67,90,NULL,NULL,NULL),(68,90,'A bit string has odd parity if the number of 1\'s is odd. A bit string has even parity if the number of 1\'s is even. Zero is considered to be an even number, so a bit string with no 1\'s has even parity. Note that the number of 0\'s does not affect the parity of a bit string.','The input consists of one or more strings, each on a line by itself, followed by a line containing only \"#\" that signals the end of the input. Each string contains 1–31 bits followed by either a lowercase letter \'e\' or a lowercase letter \'o\'.','Each line of output must look just like the corresponding line of input, except that the letter at the end is replaced by the correct bit so that the entire bit string has even parity (if the letter was \'e\') or odd parity (if the letter was \'o\').');
